import React from 'react'
import { Button, Stack } from 'react-bootstrap'

const Todo = ({text}) => {
    return (
        <div>
            <Stack direction="horizontal">
            <h3>{text}</h3>
            <Button variant="danger">Delete</Button>
            </Stack>

        </div>
    )
}

export default Todo
